import React from 'react';

const Volunteer = () => (
  <div>
    <h1>Volunteer Experience</h1>
    <p>Mentor Program - Pierre SD, 2011 - 2012</p>
    <p>Helped incoming Eagle Creek employees, many right out of college, adjust to a new job and city.</p>
  </div>
);

export default Volunteer;
